import React, { useState, useEffect } from "react";

const Home = () => {
  const [dogs, setDogs] = useState([]);

  useEffect(() => {
    const fetchDogData = async () => {
      try {
        const res = await fetch("https://api.thedogapi.com/v1/breeds");
        const data = await res.json();
        setDogs(data);
        console.log(data);
      } catch (error) {
        console.log(error);
      }
    };
    fetchDogData();
  }, []);

  return (
    <>
      {!dogs ? (
        <h1>Loading...</h1>
      ) : (
        <>
          <section className="card">
            <h1>The Dog App</h1>
          </section>
        </>
      )}
    </>
  );
};

